import React from 'react';

class PriceList extends React.Component {

  state = {
    pricePerPrintInWei: null,
    pricePerPrintIntlShipInWei: null,
    pricePerNFCInWei: null,
    pricePerNFCIntlShipInWei: null,
    pricePerMiscInWei: null,
    pricePerMiscIntlShipInWei: null
  }

  componentDidMount() {

const { drizzleState } = this.props;
const contract = drizzleState.contracts.PunkPrintRegistry;

const pricePerPrintInWei = contract.pricePerPrintInWei['0x0'].value;
